import * as styleSass from '../../../styles/buttons.module.scss'

function Button({ children, styleProp }) {
  const styleProps = {
    width: `${styleProp.width}`,
    height: `${styleProp.width}`,
  }
  return (
    <button styles={{ styleProps }} className={styleSass.button}>
      {children}
    </button>
  )
}
export default Button
